/** @format */
import Navbar from "./components/Navbar";
import { Routes } from "react-router-dom";
import Sidebar from "./components/Sidebar";

function App() {
	return (
		<>
			<Navbar />
			<SidebarContainer>
				<Sidebar />
				<Others>Other pages</Others>
			</SidebarContainer>
			<Routes></Routes>
		</>
	);
}

export default App;

const SidebarContainer = styled.div``;
const Others = styled.div``;
